import React from "react";
import ReactDom from "react-dom";
import "./index.css"

var img1 = "http://lorempixel.com/380/200";
var img2 = "http://lorempixel.com/300/200";
var img3 = "http://lorempixel.com/420/200";
var Blog_link = "https://techdaytodays.blogspot.com/";
var Channel_name = "TECH  &snbp TODAY";


ReactDom.render(
    <>
    {/* In the below line contentEditable is used to edit the content of the H1 inside the page also */}
    <h1 contentEditable="true">{Channel_name}</h1>
    <div className="img">
    <img src={img1} alt="randomImage"/>
    <img src={img2} alt="randomImage"/>
    <a href= {Blog_link} target="_Abhishek">
    <img src={img3} alt="randomImage"/>
    </a>
    </div>
    </>,document.getElementById("root")
)
